import Vue from 'vue'

import ThemeLayout from '@themeLayout'
import ThemeNotFound from '@themeNotFound'
import { injectMixins } from '@app/util'
import rootMixins from '@app/root-mixins'

injectMixins(ThemeLayout, rootMixins)
injectMixins(ThemeNotFound, rootMixins)

export const routes = [
  {
    name: "v-94c3618d9611f",
    path: "/REDEME.html",
    component: ThemeLayout,
    beforeEnter: (to, from, next) => {
      import("/Users/berlin/www/personal/github/interview-highlignts/docs/REDEME.md").then(comp => {
        Vue.component("v-94c3618d9611f", comp.default)
        next()
      })
    }
  },
  {
    name: "v-4030a6964b08b",
    path: "/html/",
    component: ThemeLayout,
    beforeEnter: (to, from, next) => {
      import("/Users/berlin/www/personal/github/interview-highlignts/docs/html/index.md").then(comp => {
        Vue.component("v-4030a6964b08b", comp.default)
        next()
      })
    }
  },
  {
    path: "/html/index.html",
    redirect: "/html/"
  },
  {
    name: "v-b548addf2c2f8",
    path: "/prepare/",
    component: ThemeLayout,
    beforeEnter: (to, from, next) => {
      import("/Users/berlin/www/personal/github/interview-highlignts/docs/prepare/index.md").then(comp => {
        Vue.component("v-b548addf2c2f8", comp.default)
        next()
      })
    }
  },
  {
    path: "/prepare/index.html",
    redirect: "/prepare/"
  },
  {
    path: '*',
    component: ThemeNotFound
  }
]
